import React from 'react';

const About = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Left',
        alignItems: 'Left',
        height: '100vh',
        paddingLeft: 20
      }}
    >
      <h4>Apple stock analysis for CMSC 437 at University of Maryland, Baltimore County.</h4>
      <br></br>
      <h4>Collaborators: Claire Kim, Yara Younis, and Megha Singh</h4>
    </div>
  );
};

export default About;
